import React, { Component, Fragment } from 'react';
import Navbar from '../../UI/Navbar';

import '../../../App.css';

class RealEstate extends Component {
    render () {
        return (
            <Fragment>
                <div className="home-wrapper">
                    <Navbar></Navbar>
                    <div className="container">
                        <div className="content-wrapper">
                            <h5></h5>
                            <p className="mt-4">The housing market has taken a devastating hit over the past few years.  Foreclosure rates are at an all-time high.  Unfortunately, our community has seen an increase in fraud associated with the real estate market.  Consequently, the District Attorneyâ€™s Office has an investigator and prosecutor assigned specifically to Real Estate Fraud.  This team focuses on cases involving real property investments (including deeds of trust and real property securities), foreclosures scams, loan modification scams, and fraud in connection with real property transactions.  They coordinate with other county, state, and federal agencies as real estate cases tend to span multiple jurisdictions.</p>
                            <p className="mt-4">If you have a case involving real estate fraud, please download the Real Estate Fraud Complaint Form.  Complete the form, attach any supporting documentation, and forward it to the address provided for review.    </p>
                            <p className="mt-4">Adobe Acrobat Required</p>
                            <p>Complaint Forms</p>
                            <a href="">English/</a>
                            <a href="">Spanish</a>
                        </div>
                    </div>
                </div>
            </Fragment>
        )
    }
}

export default RealEstate;
